#include "cub3d.h"

int		deal_key(int key, t_mlx *tab)
{
	if (key == ESC)
		exit(ESC);
	else if (key == A)
	{
		mlx_pixel_put(tab->mlx_ptr, tab->window, 300, 600, 0x23BAC4);
	}
//	ft_putnbr_fd(key, 1);
	return(0);
}

